import React from 'react';
import './ChooseAlgo.css';

function ChooseAlgo() {
    return (
        <div>
            <body className="App-choose">
                <p style={{ fontSize: 40, textAlign: "center" }}>Choose ur algo</p>
                <form>
                    <label>
                        <select style={{ blockSize: 20 }}>
                            <option>Bubble Sort</option>
                            <option>Merge Sort</option>
                        </select>
                    </label>

                </form>
                <br></br>
                <input type="submit" value="Submit" />
            </body>


        </div>
    );
}

export default ChooseAlgo;
